DROP TABLE IF EXISTS "angkutan_umum";
CREATE TABLE "angkutan_umum" ("id" INTEGER NOT NULL , "no_trayek" VARCHAR NOT NULL , "simpul" VARCHAR NOT NULL );
DROP TABLE IF EXISTS "graph";
CREATE TABLE "graph" ("id" INTEGER NOT NULL  UNIQUE , "simpul_awal" INTEGER NOT NULL , "simpul_tujuan" INTEGER NOT NULL , "jalur" TEXT NOT NULL , "bobot" DOUBLE NOT NULL );
DROP TABLE IF EXISTS "sekolah";
CREATE TABLE "sekolah" ("id" INTEGER NOT NULL  UNIQUE , "sekolah" VARCHAR NOT NULL , "koordinat" TEXT NOT NULL );
